import React, { Component } from 'react';
import Axios from 'axios';
var req = require.context(".images", false, /.*\.svg$/);
req.keys().forEach(function(key){
    req(key);
});

export class FirstPg extends Component {

    constructor(props) {
        super(props)

        this.state = {
             images: []
        }
    }

    componentDidMount() {

        this.state.images = this.importAll(require.context('./images', false, /\.(png|jpe?g|svg)$/));

        console.log(this.state.images);

        console.log(this.state.images['63706.jpg']);

        console.log(this.state.images['63706.jpg']['default']);

        Axios.get("https://api.npoint.io/d6bd0efc05639084eb17/")
        .then(response => {
            console.log(response);
        })
        .catch(error => {
            console.log(error);
        });
    }

    importAll = (r) => {
        let images = {};
        r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
        return images;
    }

    render() {
        return (
            <div className='container'>
                <div className='row'>
                    <div className='col-md-4 card'>
                        <img className="card-img-top" src={this.state.images['63706.jpg']} alt="Card image"/>
                        <div className="card-body">
                            <h4 className="card-title">John Doe</h4>
                            <p className="card-text">Some example text.</p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default FirstPg
